import style from "./PedidoGenerado.module.css"
import { Link } from "react-router-dom";
import texLogo from "../../../../assets/logos/logo_tex_modern.png"



const PedidoGenerado = () =>{
    return(
        <div>
        <header id={style.header}>
            <div>
                <Link>
                    <img src={texLogo} alt="" />
                </Link>
            </div>
        </header>
    </div>
    )
};

export default PedidoGenerado;
